const mobilePhones = [
    'Samsung Galaxy',
    'Nokia 3310',
    'Blackberry XZ',
    'iPhone12',
    'Xiaomi 5',
    'Oppo4',
    'iPhone11',
    'Samsung'
]

function ShoppingList() {
    return <ul>
        {mobilePhones.map((smartphone, index) => {
            <li key={`${smartphone}`-`${index}`}>{smartphone}</li>
        })}
    </ul>
}

export default ShoppingList;
